import React from 'react';
import NavBar from '../../nav/nav.js'
import ShopNav from '../shopnav/shopnav.js'
import './products.css'

const Products = (props) => {



    return (
        <div>
            <NavBar />
            <ShopNav />
            <div className="products">
                <h1>{props.match.params.productType}</h1>
            </div>
        </div>
    );
};

export default Products;
